import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
    Button, Card, CardTitle, Col, Row,CardText
} from 'reactstrap';


export default function Resul(props) {

    return (

        <Row>
            <Col sm="6">
                {props.result.map((pregunta, index) => (

                    <Card
                        key={index}
                        body
                        className="my-2"
                        style={{
                            width: '30rem'

                        }}
                    >
                        <CardTitle tag="h5">
                            {pregunta.valor}{pregunta.tipo}
                        </CardTitle>
                        <CardText>
        With supporting text below as a natural lead-in to additional content.
      </CardText>
                        <br />
                        {pregunta.respuestas.map((respuesta, index) => (
                            <><Button key={index} color='primary' outline>{respuesta.respuesta}</Button>&nbsp;</>
                        ))}
                    </Card>
                ))}


            </Col>
        </Row>
    );
}
